DROP TABLE IF EXISTS `expediente`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `expediente` (
  `exp_id` int NOT NULL AUTO_INCREMENT,
  `ses_id` int NOT NULL,
  `nivel_id` int NOT NULL,
  `genCop_id` int NOT NULL,
  `esc_code` int NOT NULL,
  `resol_id` int NOT NULL,
  `per_id` int NOT NULL,
  `actAca_id` int NOT NULL,
  `fecha_actAca` date NOT NULL,
  `den_id` int NOT NULL,
  `subDen_id` int DEFAULT NULL,
  `exp_denominacion` varchar(300) COLLATE utf8_spanish_ci NOT NULL,
  `exp_procesado` smallint NOT NULL DEFAULT '0',
  `exp_estado` smallint NOT NULL DEFAULT '1',
  `exp_createdate` datetime DEFAULT NULL,
  `exp_modifieddate` datetime DEFAULT NULL,
  `exp_deletedate` datetime DEFAULT NULL,
  PRIMARY KEY (`exp_id`),
  KEY `fk_exp_ses_idx` (`ses_id`),
  KEY `fk_exp_gencop_idx` (`genCop_id`),
  KEY `fk_exp_nivel_idx` (`nivel_id`),
  KEY `fk_exp_esc_idx` (`esc_code`),
  KEY `fk_exp_resol_idx` (`resol_id`),
  KEY `fk_exp_per_idx` (`per_id`),
  KEY `fk_exp_actAca_idx` (`actAca_id`),
  KEY `fk_exp_den_idx` (`den_id`),
  KEY `fk_exp_subDen_idx` (`subDen_id`),
  CONSTRAINT `fk_exp_actAca` FOREIGN KEY (`actAca_id`) REFERENCES `acto_academico` (`actAca_id`),
  CONSTRAINT `fk_exp_den` FOREIGN KEY (`den_id`) REFERENCES `denominacion` (`den_id`),
  CONSTRAINT `fk_exp_esc` FOREIGN KEY (`esc_code`) REFERENCES `escuela` (`esc_id`),
  CONSTRAINT `fk_exp_gencop` FOREIGN KEY (`genCop_id`) REFERENCES `generacion_copia` (`genCop_id`),
  CONSTRAINT `fk_exp_nivel` FOREIGN KEY (`nivel_id`) REFERENCES `nivel` (`nivel_id`),
  CONSTRAINT `fk_exp_per` FOREIGN KEY (`per_id`) REFERENCES `persona` (`per_id`),
  CONSTRAINT `fk_exp_resol` FOREIGN KEY (`resol_id`) REFERENCES `resolucion` (`resol_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `fk_exp_ses` FOREIGN KEY (`ses_id`) REFERENCES `sesion` (`ses_id`),
  CONSTRAINT `fk_exp_subDen` FOREIGN KEY (`subDen_id`) REFERENCES `subdenominacion` (`subDen_id`)
) ENGINE=InnoDB AUTO_INCREMENT=171 DEFAULT CHARSET=utf8mb3 COLLATE=utf8_spanish_ci;
